BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "android_metadata" (
	"locale"	TEXT
);
CREATE TABLE IF NOT EXISTS "room_master_table" (
	"id"	INTEGER,
	"identity_hash"	TEXT,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "user_table" (
	"id_user"	INTEGER NOT NULL,
	"firstName"	TEXT NOT NULL,
	"lastName"	TEXT NOT NULL,
	"login"	TEXT NOT NULL,
	"password"	TEXT NOT NULL,
	PRIMARY KEY("id_user" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "ad_table" (
	"id_ad"	INTEGER NOT NULL,
	"title"	TEXT NOT NULL,
	"description"	TEXT NOT NULL,
	"category"	INTEGER NOT NULL,
	"price"	INTEGER NOT NULL,
	"date"	INTEGER NOT NULL,
	"id_user_"	INTEGER NOT NULL,
	FOREIGN KEY("id_user_") REFERENCES "user_table"("id_user") ON UPDATE NO ACTION ON DELETE CASCADE,
	PRIMARY KEY("id_ad" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "parchasehistory_table" (
	"id_order"	INTEGER NOT NULL,
	"id_ad_"	INTEGER NOT NULL,
	"title"	TEXT NOT NULL,
	"price"	INTEGER NOT NULL,
	"num"	INTEGER NOT NULL,
	"date"	INTEGER NOT NULL,
	"id_user_"	INTEGER NOT NULL,
	FOREIGN KEY("id_user_") REFERENCES "user_table"("id_user") ON UPDATE NO ACTION ON DELETE CASCADE,
	FOREIGN KEY("id_ad_") REFERENCES "ad_table"("id_ad") ON UPDATE NO ACTION ON DELETE CASCADE,
	PRIMARY KEY("id_order" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "images_table" (
	"id_image"	INTEGER NOT NULL,
	"image"	BLOB NOT NULL,
	"id_ad_"	INTEGER NOT NULL,
	"rank_in_ad"	INTEGER NOT NULL,
	FOREIGN KEY("id_ad_") REFERENCES "ad_table"("id_ad") ON UPDATE NO ACTION ON DELETE CASCADE,
	PRIMARY KEY("id_image" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "favorite_table" (
	"id_favorite"	INTEGER NOT NULL,
	"id_ad_"	INTEGER NOT NULL,
	"id_user_"	INTEGER NOT NULL,
	FOREIGN KEY("id_ad_") REFERENCES "ad_table"("id_ad") ON UPDATE NO ACTION ON DELETE CASCADE,
	FOREIGN KEY("id_user_") REFERENCES "user_table"("id_user") ON UPDATE NO ACTION ON DELETE CASCADE,
	PRIMARY KEY("id_favorite" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "user_information_table" (
	"id_info"	INTEGER NOT NULL,
	"phone_number"	TEXT NOT NULL,
	"email"	TEXT NOT NULL,
	"date_registry"	INTEGER NOT NULL,
	"location"	TEXT NOT NULL,
	"image_user"	BLOB NOT NULL,
	"id_user_"	INTEGER NOT NULL,
	FOREIGN KEY("id_user_") REFERENCES "user_table"("id_user") ON UPDATE NO ACTION ON DELETE CASCADE,
	PRIMARY KEY("id_info" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "cart_table" (
	"id_cart"	INTEGER NOT NULL,
	"num"	INTEGER NOT NULL,
	"date"	INTEGER NOT NULL,
	"id_ad_"	INTEGER NOT NULL,
	"id_user_"	INTEGER NOT NULL,
	FOREIGN KEY("id_ad_") REFERENCES "ad_table"("id_ad") ON UPDATE NO ACTION ON DELETE CASCADE,
	FOREIGN KEY("id_user_") REFERENCES "user_table"("id_user") ON UPDATE NO ACTION ON DELETE CASCADE,
	PRIMARY KEY("id_cart" AUTOINCREMENT)
);
CREATE UNIQUE INDEX IF NOT EXISTS "index_user_table_login" ON "user_table" (
	"login"
);
CREATE UNIQUE INDEX IF NOT EXISTS "index_user_information_table_id_user_" ON "user_information_table" (
	"id_user_"
);
COMMIT;
